def sum_product(numbers: List[int]) -> Tuple[int, int]:
    sum_value = 0
    prod_value = 1
    if not numbers:
        return (0, 1)
    for n in numbers:
        sum_value += n
        prod_value *= n
    return sum_value, prod_value

